import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "./notes";

function App(){
   return <div>
             <Header />
             {notes.map((note)=>{
           return <Note
           title={note.title}
           about={note.content}

          />
   
})}
             <Footer />
          </div>
}

export default App;
